import { css } from '@emotion/css';

export const styContainer = css`
  height: calc(100vh - 35px);
  padding: 15px 20px 0px 25px;
`;

export const styTitle = css`
  font-family: 'Poppins', sans-serif;
  font-weight: 600;
  font-size: 35px;
`;

export const styContainerBtn = css`
  display: flex;
  align-items: center;
  justify-content: space-between;
  margin-top: 20px;
`;

export const stySku = css`
  font-size: 15px;
  color: #808080;
`;

export const styInventoryName = css`
  font-family: 'Poppins', sans-serif;
  font-weight: 600;
  font-size: 22px;
`;

export const styContainerPrice = css`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 80%;
  margin-right: 20px;
  margin-top: 10px;
`;

export const styPrice = css`
  width: 70%;
  margin-right: 20px;
`;

export const styContainerSupplier = css`
  margin-top: 20px;
`;

export const styContainerInventory = css`
  border: 1px solid #808080;
  padding: 10px;
  border-radius: 5px;
  display: block;
`;

export const stySupplierName = css`
  font-size: 20px;
`;
